import React from 'react';

const MyMenu = ({ recipes }) => {
    return (
        <div className="my-menu">
            <h3>My Menu</h3>
            <ul>
                {recipes.map((recipe, index) => (
                    <li key={index}>
                        <div>{recipe.name}</div> {/* Замените recipe.name на соответствующие свойства вашего объекта рецепта */}
                        <div>{recipe.photo}</div>
                        <div>{recipe.ingredients}</div>
                        <div>{recipe.method}</div>
                        <div>{recipe.calories}</div>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default MyMenu;
